import React from 'react'
import { Route, Routes, Link } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import VideoDetails from './VideoDetails';

const Video = (props) => {
  const video_url  = props.video_url;

  return (
    <div className="videoContent">
      <div className="videoUpperContent">
        <video width="558" height="290" controls>
          <source type="video/mp4" src={video_url.slice(0,25) + "uc?export=view&id=" + video_url.slice(32,65)}></source>
        </video>
      </div>

      <div className="videoLowerContent">
        <BrowserRouter>
          <Routes>
            <Route exact path='/Home' element={
              <Link to='geeks/VideoDetails' target='_blank'>View Details</Link>
              }>
            </Route>

            <Route exact path='/geeks/VideoDetails' element={<VideoDetails />}></Route>
          </Routes>
        </BrowserRouter>
      </div>  
    </div>
  )
}

export default Video

